import Head from './myCompnents/Head.js';
import './App.css';
import Body from './myCompnents/Body';
import { Footer } from './myCompnents/Footer';
import About from './myCompnents/About';
import Region from './myCompnents/Region';
import Form from './myCompnents/Form.js';
import South from './myCompnents/South';
import Hazara from './myCompnents/Hazara';
import Malakand from './myCompnents/Malakand';
import Watershed from './myCompnents/Watershed';
import {BrowserRouter as Router,Routes,Route} from "react-router-dom";

function App() {
  return (
    <>
      <Router>
      <Head/>
        <Routes>
          <Route path='/' element={<Body/>}/>
          <Route path='/form' element={<Form/>}/>
          <Route path='/about' element={<About/>}/>
          <Route path='/region' element={<Region/>}/>
          <Route path='/south' element={<South/>}/>
          <Route path='/malakand' element={<Malakand/>}/>
          <Route path='/hazara' element={<Hazara/>}/>
          <Route path='/watershed' element={<Watershed/>}/>
        </Routes>
      </Router>
      <Footer/>
    </>
  );
}

export default App;
